import React from 'react';

// Компоненты
class Users extends React.Component{

    users = [
        {
            id: 1,
            firstname: "Alexey",
            lastname: "Orlov",
            bio: "Man",
            age: 25,
            isHappy: true
        },
        {
            id: 2,
            firstname: "Lera",
            lastname: "Orlova",
            bio: "Women",
            age: 23,
            isHappy: false
        }
    ]

	render () {
		return(<div>
            {this.users.map((user) => (<div className='user'>
                <h3>{user.firstname} {user.lastname}</h3>
                <p>{user.bio}</p>
            </div>))}
        </div>)
	}
}

export default Users;
